import React from 'react';
import styles from './Users.css';

let Users =(props) => {
    return <div>
        {
        props.Users.map ( u => <div key= {u.id}>
<span>
    <div>
        <img src={u.photoUrl} />
    </div>
    <div>
         {u.nickname}
    </div>
</span>

        </div>)
        }
    </div>
}

export default Users;
